import { CardContainer } from "./styles"


interface ICard {

    children: React.ReactElement
    title: string;
    description: string;

}
export function Card({
    image,
    title,
    description
}: ICard){

    return (
            <CardContainer>

            {image} 
            {title}
            {description}

            </CardContainer>
    )
}
